import React, { useState } from 'react';
import styled from 'styled-components';
import SunIcon from '../images/sum.png';

const Cards = styled.div`
  display: flex;
  justify-content: center;
  background-color: blueviolet;
  width: 100%;
  height: 100%;
  padding: 60px 0;

  div {
    width: 450px;
    height: 575px;
    border-radius: 50px;
    background-color: purple;
    margin-right: 40px;
  }
`;

const Burger = styled.div`
  display: flex;
  justify-content: flex-end;

  div {
    height: 20px;
    top: 3px;
    width: 25px;
    z-index: 5;

    span {
      background: black;
      display: block;
      height: 2px;
      left: 0;
      margin-top: -1px;
      top: 50%;

      transition: 0.5s;
      width: 100%;
    }
  }
`;

const SunIconStyled = styled.a`
  display: block;
  img {
    width: 40px;
    height: 40px;
    background-color: purple;
  }
`;

type Props = {};

type Task = {
  label: string;
};

