  const [tasks, setTasks] = useState<Task[]>([]);

  return (
    <Cards>
      <div>
        <SunIconStyled>
          <img src={SunIcon} />
        </SunIconStyled>

        <Burger>
          <span />
          <span />
          <span />
        </Burger>
      </div>
      <div>hi</div>
    </Cards>
  );
};

export default CardsWeather;
